        var path = "/beta/item/duplicate/{itemId}"
        path = path.stringByReplacingOccurrencesOfString("{itemId}", withString: "\(itemId)", options: .LiteralSearch, range: nil)
        let URLString = InfoplusAPI.basePath + path

